CREATE VIEW nba_last_five_avgs AS
 SELECT ut.player_name,
    ut.team,
    avg(((to_timestamp((ut.minutes_played)::text, 'MI:SS'::text))::time without time zone)::interval) AS minutes_played,
    round(avg(ut.fgm), 1) AS fgm,
    round(avg(ut.fga), 1) AS fga,
    round(avg(ut.fg_pct), 3) AS fg_pct,
    round(avg(ut.tpm), 1) AS tpm,
    round(avg(ut.tpa), 1) AS tpa,
    round(avg(ut.tp_pct), 3) AS tp_pct,
    round(avg(ut.ftm), 1) AS ftm,
    round(avg(ut.fta), 1) AS fta,
    round(avg(ut.ft_pct), 3) AS ft_pct,
    round(avg(ut.orb), 1) AS orb,
    round(avg(ut.drb), 1) AS drb,
    round(avg(ut.trb), 1) AS trb,
    round(avg(ut.assists), 1) AS assists,
    round(avg(ut.steals), 1) AS steals,
    round(avg(ut.blocks), 1) AS blocks,
    round(avg(ut.tov), 1) AS tov,
    round(avg(ut.pf), 1) AS pf,
    round(avg(ut.points), 1) AS points
   FROM ( SELECT nba_game_logs.nba_game_log_id,
            nba_game_logs.player_name,
            nba_game_logs.game_date,
            nba_game_logs.team_name,
            nba_game_logs.opponent_name,
            nba_game_logs.minutes_played,
            nba_game_logs.fgm,
            nba_game_logs.fga,
            nba_game_logs.fg_pct,
            nba_game_logs.tpm,
            nba_game_logs.tpa,
            nba_game_logs.tp_pct,
            nba_game_logs.ftm,
            nba_game_logs.fta,
            nba_game_logs.ft_pct,
            nba_game_logs.orb,
            nba_game_logs.drb,
            nba_game_logs.trb,
            nba_game_logs.assists,
            nba_game_logs.steals,
            nba_game_logs.blocks,
            nba_game_logs.tov,
            nba_game_logs.pf,
            nba_game_logs.points,
            nba_roster.team,
            row_number() OVER (PARTITION BY nba_game_logs.player_name ORDER BY nba_game_logs.game_date DESC) AS rownum
           FROM nba_game_logs,
            nba_roster
          WHERE (((nba_game_logs.player_name)::text = (nba_roster.first_last)::text) AND (upper((nba_game_logs.minutes_played)::text) ~ '\d'::text))) ut
  WHERE (ut.rownum <= 5)
  GROUP BY ut.player_name, ut.team;


